    false,nt"url": null,nt"notes": "This report was undertaken to determine
    the management needs of the threatened and endangered species and the natural community
    within the Research Natural Area, Muscatatuck Seep Springs, located within Muscatatuck
    National Wildlife Refuge, in southern Indiana. The primary purpose of the Research
    Natural Area (RNA) designation is to protect the acid seep spring community as well
    as the populations of rare plant species that occur within it. Present conditions,
